import React from "react";
import Room from "./Room";
import { Link } from "react-router-dom";
const Roomlist = ({ rooms }) => {
  console.log(rooms);
  return (
    <div>
      {rooms &&
        rooms.map(
          (room) => (
            <>
              <Room name={room.name} />
            </>
          )
          //   <Link to={`/chat/`+room._id+"/"+room.name} key={room._id}  >
          /* </Link>; */
        )}
    </div>
  );
};

export default Roomlist;
